import React, { Suspense, useRef, useState } from "react";
import { Canvas } from "@react-three/fiber";
import { useGLTF, OrbitControls } from "@react-three/drei";

function Model({ ...props }) {
    const group = useRef()
    const { nodes, materials } = useGLTF('pokemon_jigglypuff/rondoudou.gltf')
    return (
      <group ref={group} {...props} dispose={null}>
        <group rotation={[-Math.PI / 2, 0, 0]}>
          <group rotation={[Math.PI / 2, 0, 0]}>
            <group position={[0, -2.13, 0]} rotation={[Math.PI / 2, 0, 0]} scale={0.01}>
              <mesh geometry={nodes.Group5425_Material002_0.geometry} material={materials['Material.002']} />
              <mesh geometry={nodes.Group5425_Material002_0_1.geometry} material={materials['Material.002']} />
            </group>
            <group rotation={[Math.PI / 2, 0, 0]} scale={0.01}>
              <mesh geometry={nodes.Group5425001_Material003_0.geometry} material={materials['Material.003']} />
            </group>
          </group>
        </group>
      </group>
    )
  }

const ThreeLogo = () => {
    const ref = useRef()
    return (
        <>
            <Canvas>
                <Suspense fallback={null}>
                    <ambientLight />
                    <Model />
                </Suspense>
            </Canvas>
        </>
    )
}

export default ThreeLogo
